export const fetchData = async (type, num) => {
  if(num !== '') {
    console.log('num not 0!', num)
  }
    try {
      const response = await fetch("https://jsonplaceholder.typicode.com/posts");
      const data = await response.json();
      return data;
    } catch (e) {
      console.log(e);
    }

};
